-- ----------------------------
-- Table structure for cloud_env
-- ----------------------------
DROP TABLE IF EXISTS `cloud_env`;
CREATE TABLE `cloud_env` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `vasp_license_id` int NOT NULL COMMENT 'vaspLicense id',
  `cloud_secret_id` varchar(56) NOT NULL COMMENT '腾讯云secretId',
  `cloud_app_id` varchar(56) NOT NULL COMMENT '腾讯云APPID',
  `region` varchar(56) NOT NULL DEFAULT '' COMMENT '腾讯云地区',
  `zone` varchar(56) NOT NULL DEFAULT '' COMMENT '腾讯云地区区域',
  `cloud_project_id` varchar(56) NOT NULL DEFAULT '0' COMMENT '腾讯云项目id',
  `cloud_account_id` varchar(56) NOT NULL DEFAULT '' COMMENT '腾讯云账户id',
  `vpc_id` varchar(56) NOT NULL DEFAULT '' COMMENT '私有网络id',
  `subnet_id` varchar(56) NOT NULL DEFAULT '' COMMENT '子网id',
  `security_group_id` varchar(56) NOT NULL DEFAULT '' COMMENT '安全组id',
  `cos_bucket` varchar(255) NOT NULL DEFAULT '' COMMENT 'COS id',
  `cluster_id` varchar(56) NOT NULL DEFAULT '' COMMENT 'TKE集群id',
  `instance_id` varchar(56) NOT NULL DEFAULT '' COMMENT 'cmv实例腾讯云id',
  `instance_ip` varchar(255) NOT NULL DEFAULT '' COMMENT 'cvm实例公网ip',
  `instance_password` varchar(255) NOT NULL DEFAULT '' COMMENT 'cvm实例登录密码',
  `status` tinyint NOT NULL DEFAULT '1' COMMENT '状态 1=创建中 | 2=创建失败 | 3=创建成功',
  `err_msg` varchar(1024) NOT NULL DEFAULT '' COMMENT '创建失败时返回的错误消息',
  `create_at` bigint NOT NULL COMMENT '创建时间',
  `update_at` bigint NOT NULL COMMENT '更新时间',
  `delete_at` bigint NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_cloud_secret_id` (`cloud_secret_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- ----------------------------
-- Records of cloud_env
-- ----------------------------

-- ----------------------------
-- Table structure for experiment
-- ----------------------------
DROP TABLE IF EXISTS `experiment`;
CREATE TABLE `experiment` (
  `id` int NOT NULL AUTO_INCREMENT,
  `pid` int DEFAULT '0' COMMENT '父id',
  `user_id` int NOT NULL,
  `project_id` int NOT NULL COMMENT '所属项目id',
  `cloud_env_id` int NOT NULL COMMENT '腾讯云环境id',
  `name` char(60) NOT NULL COMMENT '实验名',
  `experiment_type` char(25) NOT NULL DEFAULT '' COMMENT '实验类型',
  `cos_base_path` varchar(255) NOT NULL DEFAULT '' COMMENT 'cos基本路径',
  `memo` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint NOT NULL COMMENT '1=未实验（草稿） | 2=创建环境 | 3=计算中 | 4=被终止 | 5=失败 | 6=成功',
  `laboratory_address` varchar(56) NOT NULL COMMENT '实验室地址 ip+port',
  `zone` char(56) NOT NULL DEFAULT '' COMMENT '实验腾讯云zone',
  `batch_compute_env_id` char(56) NOT NULL DEFAULT '' COMMENT '实验batch计算环境id',
  `batch_jid` char(56) NOT NULL DEFAULT '' COMMENT '腾讯云batch compute jid',
  `is_template` tinyint NOT NULL COMMENT '是否模板 1=否 2=是',
  `last_edit_at` bigint NOT NULL COMMENT '最近编辑时间',
  `compute_node_num` int NOT NULL COMMENT '计算节点数量',
  `oszicar_json` varchar(255) NOT NULL DEFAULT '' COMMENT 'OSZICAR信息（迭代次数，能量）',
  `image` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `err_msg` char(56) NOT NULL,
  `start_at` bigint NOT NULL DEFAULT '0' COMMENT '实验开始时间',
  `done_at` bigint NOT NULL DEFAULT '0' COMMENT '实验结束时间',
  `create_at` bigint NOT NULL COMMENT '创建时间',
  `update_at` bigint NOT NULL COMMENT '更新时间',
  `delete_at` bigint NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1558 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='实验表';

