DROP TABLE IF EXISTS `notify`;
CREATE TABLE `notify` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `notify_type` tinyint NOT NULL DEFAULT '1' COMMENT '消息类型 1=系统通知 2=项目通知 3=实验通知 4=VASPlicense',
