  KEY `inx_proejct` (`project_id`),
  KEY `inx_user` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1066 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

