INSERT INTO `experiment` VALUES ('745', '0', '37', '42', '22', 'ex-1', 'vasp_std', 'cos://tefs-laboratory-dev-1300241787.cos.ap-nanjing.myqcloud.com/users/37/experiments/745/', '1.4 希尔排序分类 算法尔排序，也称递减增量排序算法，是插入排序的一种更高效的改进版本。但希尔排序是非稳定排序算法。希尔排序是基于插入排序的以下两点性质而提出改进方法的：插入排序在对几乎已经排好序的数据操作时，效率高，即可以达到线性排序的效率；但插入排序一般来说是低效的，因为插入排序每次只能将数据移动一位；希尔排序的基本思想是：先将整个待排序的记录序列分割成为若干子序列分别进行', '6', '172.16.16.40:32500', 'ap-nanjing-1', 'env-26diyk7l', 'job-jygz3ds7', '1', '1614842051', '1', '{\"ionicStep\":1,\"electronStep\":0,\"energy\":-74.144311,\"time\":\"Fri Mar 05 10:56:23 2021\"}', '', '', '1614912835', '1614913019', '1614841933', '1614912835', '1616030134');
